でました！持ち歩ける三面鏡。女優ミラーで有名になったLEDライト付きミラーがコンパクトになって登場。お姫様ミラーのように、毎日のお化粧が楽しくなります。
暗い場所でも化粧直しができる、優れもの。折り畳み式観音開きだから、汚れや埃がつきません。バッグや化粧ポーチの中に入るから、どこへでも持ち運べます。今までの丸型コンパクトミラーよりも大きめで使いやすい四角型。手離しでも化粧直しできる点がおすすめ。手鏡は彼女やお母さん、逆に娘さんへの誕生日プレゼント・プチギフトとしても喜ばれています。
<BR><BR>
特徴：
ハート型のライト付きミラー<BR>
暗い場所でも明るい。
顏が明るく照らされてトーンアップして見えるから気持ち良い。<BR>卓上ミラーとしてもお使い頂けます。<BR>
メール便送料無料でお届けします。
